(16, NULL, 'N', 'N002', 'Hng dn di bc 1 qung co express', '<p><span style=\"color: #169179;\"><strong> Chn v tr&iacute; </strong><strong>hin th ph&ugrave; hp</strong></span>  ti u h&oacute;a ng&acirc;n s&aacute;ch v&agrave; mc &iacute;ch Qung C&aacute;o :<br /><br /> V tr&iacute; trang ch : Kh nng tip cn cao nht <strong><span style=\"color: #3598db;\">ph&ugrave; hp vi doanh nghip</span></strong> c&oacute; nhu cu truyn th&ocirc;ng, t&igrave;m kim kh&aacute;ch h&agrave;ng vi quy m&ocirc; rng, kh&ocirc;ng nhm ti mc ti&ecirc;u kh&aacute;ch h&agrave;ng c th</p>\r\n<p> V tr&iacute; trang chuy&ecirc;n mc <span style=\"color: #e03e2d;\"><em>(  Xut )</em></span>&nbsp; :&nbsp; Tip cn &uacute;ng nh&oacute;m kh&aacute;ch h&agrave;ng mc ti&ecirc;u, gi&uacute;p ti u ng&acirc;n s&aacute;ch trong vic chuyn i kh&aacute;ch h&agrave;ng. <span style=\"color: #3598db;\"><strong>Ph&ugrave; hp vi ng&acirc;n s&aacute;ch va v&agrave; thp</strong></span></p>', 1647277765, 1, NULL, NULL),
(17, NULL, 'N', 'N003', 'Ghi ch bc 2 qung co express', '<p> Chin dch qung c&aacute;o cn c x&eacute;t duyt trc khi hin th tr&ecirc;n h thng website,  qung c&aacute;o c x&eacute;t duyt sm banner qung c&aacute;o cn &aacute;p ng c&aacute;c ti&ecirc;u ch&iacute; sau :<br /><br />+ <span style=\"color: #169179;\">K&iacute;ch thc banner</span> : 600x300 ( Pixel ) vi banner <span style=\"color: #169179;\"><strong>Dc 2 b&ecirc;n website tr&ecirc;n PC</strong></span> hoc 600 x 600( px)&nbsp; vi <span style=\"color: #3598db;\"><strong>banner Qung c&aacute;o tr&ecirc;n thit b di ng</strong></span><br />+ <span style=\"color: #169179;\">H&igrave;nh nh&nbsp;</span> : r&otilde; d&agrave;ng kh&ocirc;ng b b&oacute;p m&eacute;o<br />+ <span style=\"color: #169179;\">Ch &nbsp;</span> &nbsp;&nbsp; :&nbsp; Ch hin th c&aacute;c banner c&oacute; ch  li&ecirc;n quan n <strong>Bt ng Sn</strong> hoc <strong>Tuyn Dng<br /></strong>+<strong> </strong><span style=\"color: #3598db;\"><span style=\"color: #ba372a;\">Dung lng</span> </span><strong>: </strong>Kh&ocirc;ng qu&aacute; 1mb<strong><br /></strong></p>\r\n<p><span style=\"color: #236fa1;\"><em><strong>Trong trng hp kh&ocirc;ng c&oacute; banner, Li&ecirc;n h vi b phn CSKH  c h tr thit k banner min ph&iacute;</strong></em></span></p>', 1647277765, 1, NULL, NULL),
(18, NULL, 'N', 'N004', 'Ghi ch xut ha n c nhn', '<p> Ngi d&ugrave;ng gi y&ecirc;u cu xut h&oacute;a n in t ti &acirc;y, <span style=\"color: #236fa1;\">Nhng lu &yacute; khi tin h&agrave;nh xut h&oacute;a n in t</span> :<br /> H&oacute;a n in t c xut t ng&agrave;y 5 n ng&agrave;y 10 h&agrave;ng th&aacute;ng<br /> Kh&aacute;ch h&agrave;ng cn gi y&ecirc;u cu xut h&oacute;a n trc ng&agrave;y 5. trong trng hp gi sau ng&agrave;y 5 h&oacute;a n c&oacute; th phi nhn v&agrave;o t tip theo<br /> n h&agrave;ng c&oacute; gi&aacute; tr tr&ecirc;n 200k mi c xut h&oacute;a n in t<br /> Mi n h&agrave;ng ch c xut h&oacute;a n 1 ln duy nht<br /><br /><br /><br /></p>', 1647277765, 1, NULL, NULL),
(19, NULL, 'N', 'N005', 'Ghi ch xut ha n doanh nghip', '<p> Ngi d&ugrave;ng gi y&ecirc;u cu xut h&oacute;a n in t ti &acirc;y, <span style=\"color: #236fa1;\">Nhng lu &yacute; khi tin h&agrave;nh xut h&oacute;a n in t</span> :<br /> H&oacute;a n in t c xut t ng&agrave;y 5 n ng&agrave;y 10 h&agrave;ng th&aacute;ng<br /> Kh&aacute;ch h&agrave;ng cn gi y&ecirc;u cu xut h&oacute;a n trc ng&agrave;y 5. trong trng hp gi sau ng&agrave;y 5 h&oacute;a n c&oacute; th phi nhn v&agrave;o t tip theo<br /> n h&agrave;ng c&oacute; gi&aacute; tr tr&ecirc;n 200k mi c xut h&oacute;a n in t<br /> Mi n h&agrave;ng ch c xut h&oacute;a n 1 ln duy nht</p>', 1647277765, 1, NULL, NULL),
(20, NULL, 'N', 'N006', 'Mo ng tin hiu qu', '<div class=\"body\">\r\n<p><span style=\"color: #ba372a;\"><strong>LU &Yacute; </strong></span>:<span style=\"color: #2dc26b;\"> </span><span style=\"color: #169179;\"><em>Khi ng tin kh&ocirc;ng li&ecirc;n quan n BS t&agrave;i khon ngi ng s b kh&oacute;a m&agrave; kh&ocirc;ng cn b&aacute;o trc.<br /></em></span></p>\r\n<p><strong><span style=\"color: #236fa1;\"></span></strong><span style=\"color: #236fa1;\">H&igrave;nh nh </span>: C&aacute;c tin ng c&oacute; h&igrave;nh nh &amp; r&otilde; n&eacute;t s hiu qu hn c&aacute;c tin ng kh&ocirc;ng c&oacute; h&igrave;nh nh. H&atilde;y Ti u k&iacute;ch thc h&igrave;nh nh ca bn nh hn 300Kb  tng tc  tri nghim ca kh&aacute;ch h&agrave;ng xem tin iu n&agrave;y s gi&uacute;p tng kh nng chuyn i &aacute;ng k. Xem <a href=\"https://riot.softonic.vn/\" target=\"_blank\" rel=\"noopener\">Hng Dn Ti u h&igrave;nh trc khi ng b&agrave;i</a></p>\r\n<p><strong><span style=\"color: #236fa1;\"></span></strong><span style=\"color: #236fa1;\">Ti&ecirc;u  </span>: Tha m&atilde;n c&aacute;c ti&ecirc;u ch&iacute; k&iacute;ch th&iacute;ch s t&ograve; m&ograve; ca kh&aacute;ch h&agrave;ng, khng nh c gi&aacute; tr ca sn phm ang b&aacute;n, <span style=\"color: #e03e2d;\"><strong>Ti a 99 k&yacute; t</strong></span></p>\r\n<p><strong><span style=\"color: #236fa1;\"></span></strong><span style=\"color: #236fa1;\">Ni dung</span>: Tin ng s hiu qu hn nu y  th&ocirc;ng tin v&agrave; minh bch v gi&aacute; b&aacute;n, ph&aacute;p l&yacute;. C&aacute;c tin ng c&oacute; ni dung kh&ocirc;ng minh bch s kh&ocirc;ng c duyt hin th tr&ecirc;n h thng &amp; t&agrave;i khon c&oacute; th b hn ch s lng ng tin trong ng&agrave;y. <span style=\"color: #2dc26b;\"><strong>Ti Thiu 200 k&yacute; t</strong></span></p>\r\n<p> Xem th&ecirc;m Chi Tit :<em> <br /> </em><em><a href=\"../trang-chu\">C&aacute;ch ng tin bt ng sn hiu qu</a><br /> <a href=\"../\">C&aacute;c chy qung c&aacute;o bng b&agrave;i vit tr&ecirc;n trang</a><br /></em><