(21, NULL, 'N', 'N007', 'Vn bn cui trang ng tin mi', '<div class=\"col-md-8\">\r\n<div class=\"outtro\">\r\n<p>Nh&agrave; t Express l&agrave; website ng tin vi nhng t&iacute;nh nng cao cp u vit nht hin nay. Ngi d&ugrave;ng c&oacute; th ng tin min ph&iacute; kh&ocirc;ng cn ng nhp.&nbsp; Tuy nhi&ecirc;n  s dng c c&aacute;c t&iacute;nh nng cao cp nh: <span style=\"color: #e67e23;\">Thng k&ecirc; d liu,&nbsp;</span><span style=\"color: #ba372a;\"><span style=\"color: #3598db;\"> Qun l&yacute; kh&aacute;ch h&agrave;ng,&nbsp;</span></span><span style=\"color: #169179;\"> Cng ng,&nbsp;</span><span style=\"color: #ba372a;\"> X&acirc;y dng thng hiu c&aacute; nh&acirc;n,&nbsp;</span><span style=\"color: #2dc26b;\"> H tr </span><span style=\"color: #169179;\"><span style=\"color: #2dc26b;\">Email Marketing CSKH</span> </span>V&agrave; c h tr duyt tin trong thi gian nhanh nht ngi d&ugrave;ng n&ecirc;n to cho m&igrave;nh 1 t&agrave;i khon ng tin ( ho&agrave;n to&agrave;n min ph&iacute; )<br />Mi thc mc trong qu&aacute; tr&igrave;nh ng tin qu&yacute; kh&aacute;ch vui l&ograve;ng <span style=\"color: #236fa1;\"><span style=\"color: #000000;\">B Phn</span> <strong>H Tr K Thut</strong></span> Hoc li&ecirc;n h:<br />Hotline CSKH :<strong> </strong><span style=\"color: #ba372a;\">090.777.2638</span> ( Gi h&agrave;nh ch&iacute;nh )  c hng dn.</p>\r\n</div>\r\n</div>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL),
