(32, NULL, 'N', 'N011', 'Vn bn khi ng k ti khon CVTV', '<p>T&agrave;i khon d&agrave;nh cho <span style=\"color: #2dc26b;\"><strong>chuy&ecirc;n vi&ecirc;n t vn - ngi m&ocirc;i gii bt ng sn</strong></span>. D d&agrave;ng x&acirc;y dng thng hiu c&aacute; nh&acirc;n, <span style=\"color: #e03e2d;\"><strong>Qun l&yacute; &amp; Chm s&oacute;c kh&aacute;ch h&agrave;ng</strong></span> to&agrave;n din th&ocirc;ng qua <span style=\"color: #f1c40f;\"><strong>h thng CRM min ph&iacute;</strong></span>.</p>\r\n<p><span style=\"color: #3598db;\"><strong>Hin th trong mc Danh b</strong></span> gi&uacute;p kh&aacute;ch h&agrave;ng quan t&acirc;m BS d d&agrave;ng t&igrave;m kim v&agrave; chn la ngi m&ocirc;i gii th&ocirc;ng qua d &aacute;n m&ocirc;i gii ang trin khai v&agrave; khu vc ang sinh sng. c h tr 24/7</p>', 1650512478, 1, NULL, NULL),
(33, NULL, 'N', 'N012', 'Vn bn khi ng k ti khon doanh nghip', '<p><span style=\"color: #169179;\"><strong>D&agrave;nh ri&ecirc;ng cho doanh nghip</strong></span> ( Ch u t - C&ocirc;ng ty M&ocirc;i gii Bt ng Sn). Bao gm tt c c&aacute;c t&iacute;nh nng tr&ecirc;n website. Tit kim ti a vi <span style=\"color: #e03e2d;\"><strong>kh nng chia s g&oacute;i tin ng</strong></span> cho t&agrave;i khon li&ecirc;n kt. D d&agrave;ng x&acirc;y dng thng hiu doanh nghip tr&ecirc;n m&ocirc;i trng online. c h tr 24/7</p>\r\n<p>&nbsp;</p>', 1650512478, 1, NULL, NULL),
