(43, 43, NULL, 'Hng bt n uy tn', NULL, '<p style=\"text-align: left;\">Tng quan<br />Khu &ocirc; th<strong>&nbsp;Vinh New Center&nbsp;</strong>ti&ecirc;n phong to lp t m hin i, ng cp u ti&ecirc;n ti x&atilde; Nghi Li&ecirc;n, th&agrave;nh ph Vinh, tnh Ngh An do c&ocirc;ng ty CP X&acirc;y dng Sn H&agrave; trin khai u t. Vi quy hoch 148 l&ocirc; lin k, bit th, nh&agrave; cao tng, c&ocirc;ng vi&ecirc;n, nh&agrave; sinh hot cng ng KT Vinh New Center s l&agrave; im dng ch&acirc;n l&yacute; tng d&agrave;nh cho gii tinh hoa.<br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125142247-5443.jpg\" /><span style=\"font-size: 10pt;\"><em>Phi cnh d &aacute;n Khu &ocirc; th Vinh New Center</em>&nbsp;</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p>&nbsp;</p>', 'hang-bot-no-uy-tin', '<p>Khu &ocirc; th Vinh New Center ta lc tr&ecirc;n tuyn ng Quc L 1A c (ng Thng Long), x&atilde; Nghi Li&ecirc;n, l&agrave; trc giao th&ocirc;ng xng sng kh&ocirc;ng ch ri&ecirc;ng TP. Vinh m&agrave; c&ograve;n c Ngh An &amp; c nc, &acirc;y s l&agrave; c hi, tim nng ph&aacute;t trin rt ln.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125170125-0c6b.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>V tr&iacute; d &aacute;n Vinh New Center&nbsp;</em> </span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><em>D &aacute;n nm  v tr&iacute; trung t&acirc;m ca khu vc, d d&agrave;ng tip cn c&aacute;c c&ocirc;ng tr&igrave;nh thit yu.&nbsp;<br />- i din bn xe Bc Vinh.&nbsp;<br />- 50m n s&acirc;n bay Vinh.&nbsp;<br />- 200m n KCN Bc Vinh.&nbsp;<br />- 300m n i l 72m Vinh - Ca L&ograve;.&nbsp;<br />- 500m n ch Vinh - Big C.&nbsp;</em></span></p>', '<p>Khu &ocirc; th Vinh New Center s hu phong c&aacute;ch thit k nh&agrave;  tinh t, lch l&atilde;m mang hi hng ti gin ang c a chung ng&agrave;y nay. L&agrave; chn an c l&iacute; tng theo xu th hin i, ni cuc sng kh&ocirc;ng ch b bao bc bi bn bc tng m&agrave; m rng v&agrave; h&ograve;a hp vi thi&ecirc;n nhi&ecirc;n m&agrave; l&agrave; ni cuc sng l&agrave; s tn hng &uacute;ng ngha.</p>\r\n<p>D &aacute;n nm c&aacute;ch trung t&acirc;m TP Vinh kh&ocirc;ng xa, nhng mang n cm nhn kh&aacute;c bit r&otilde; n&eacute;t gia s s&ocirc;i ng, n &agrave;o ca ph x&aacute; vi mt kh&ocirc;ng gian m&aacute;t m, trong l&agrave;nh v&agrave; y&ecirc;n tnh, ph y c&acirc;y xanh. Vi thit k n&agrave;y to n&ecirc;n din mo sang trng cho khu ph, t&ocirc;n vinh c&aacute;c ch nh&acirc;n, n&acirc;ng tm gi&aacute; tr cuc sng.</p>\r\n<p>Hng ti tin &iacute;ch sng khe, sng xanh, khu c&ocirc;ng vi&ecirc;n ri&ecirc;ng t c quy hoch trong khu&ocirc;n vi&ecirc;n KT.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145023-bf9d.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin &iacute;ch Khu &ocirc; th Vinh New Center</em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145105-a7b0.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin &iacute;ch Khu &ocirc; th Vinh New Center&nbsp; </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145120-2722.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin &iacute;ch Khu &ocirc; th Vinh New Center&nbsp; </em></span></p>', '<p>Khu &ocirc; th Vinh New Center do c&ocirc;ng ty CP Kin tr&uacute;c QTA &nbsp;t vn lp quy hoch. Vi c&aacute;c tin &iacute;ch a dng, kh&ocirc;ng gian sinh th&aacute;i trong l&agrave;nh, cng ng c d&acirc;n vn minh, hnh ph&uacute;c v&agrave; h&ograve;a hp v phong c&aacute;ch sng.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125150640-53e3.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Phi cnh mt bng tng th khu &ocirc; th Vinh New Center</em>&nbsp;</span></p>\r\n<p>D &aacute;n vi quy m&ocirc; ln bao gm 148 l&ocirc; lin k, bit th, nh&agrave; cao tng, c&ocirc;ng vi&ecirc;n, nh&agrave; sinh hot cng ng, trong &oacute; c&oacute; nhiu loi din t&iacute;ch.</p>\r\n<p>Din t&iacute;ch t 93m2, 136m2, 180m2, 200m2 &nbsp;vi mt tin t 5.5, 8m, 11m &nbsp;- ng quy hoch rng t 11m ti 15m.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125151125-d361.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Thit k nh&agrave; ph Khu &ocirc; th Vinh New Center&nbsp;</em>&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125153127-7443.jpg\" /> </span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Thit k nh&agrave; ph Khu &ocirc; th Vinh New Center&nbsp;</em> </span></p>', '<p>D &aacute;n Vinh New Center c ch u t c&ocirc;ng ty CP X&acirc;y dng Sn H&agrave; m b&aacute;n v&agrave;o th&aacute;ng 1 nm 2022. Hin ti c&aacute;c nn ph&acirc;n l&ocirc; &atilde; c khi c&ocirc;ng v&agrave; tng bc trin khai.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125152044-92fe.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin  d &aacute;n Khu &ocirc; th Vinh New Center th&aacute;ng 1 nm 2022</em> </span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125152128-3156.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin  d &aacute;n Khu &ocirc; th Vinh New Center th&aacute;ng 1 nm 2022 </em></span></p>', '<p>G&iacute;a b&aacute;n d &aacute;n<strong>&nbsp;</strong>Khu &ocirc; th Vinh New Center d kin ch t 14 &ndash; 17 triu/m2. ( G&iacute;a t ).</p>', 7, 1000, 8, '500.00', NULL, 1, '12.50', NULL, 1, '[1,2,3,4,5,8,9,10,11,12]', 2, 8, NULL, NULL, 31, 1200, 9, '1', NULL, NULL, NULL, 'https://www.youtube.com/embed/fsBSidZk954', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Hng bt n uy tn', 'Hng bt n uy tn', 'Tng quan\r\nKhu  thVinh New Centertin phong to lp t m hin i, ng cp u tin ti x Nghi Lin, thnh ph Vinh, tnh Ngh An do cng ty CP Xy dng Sn H trin khai u t. Vi quy hoch', NULL, NULL, NULL, 1, 0, 1643117905, 1643384667, NULL, 12, 16, NULL, NULL, NULL, 'Ph hng tng', 5, '/uploads/21/project/duong-qua.jpg', '[\"\\/uploads\\/21\\/project\\/Copy%20of%20J2%20Colorful%20Energy.jpg\",\"\\/uploads\\/21\\/project\\/Copy%20of%20J2%20Crystal%20Ice.jpg\",\"\\/uploads\\/21\\/project\\/Copy%20of%20J2%20Space.jpg\",\"\\/uploads\\/21\\/project\\/duong-qua.jpg\"]', 2, 21, 21, 0, NULL),
(44, 43, NULL, 'Hng bt n uy tn 122', NULL, '<p style=\"text-align: left;\">Tng quan<br />Khu &ocirc; th<strong>&nbsp;Vinh New Center&nbsp;</strong>ti&ecirc;n phong to lp t m hin i, ng cp u ti&ecirc;n ti x&atilde; Nghi Li&ecirc;n, th&agrave;nh ph Vinh, tnh Ngh An do c&ocirc;ng ty CP X&acirc;y dng Sn H&agrave; trin khai u t. Vi quy hoch 148 l&ocirc; lin k, bit th, nh&agrave; cao tng, c&ocirc;ng vi&ecirc;n, nh&agrave; sinh hot cng ng KT Vinh New Center s l&agrave; im dng ch&acirc;n l&yacute; tng d&agrave;nh cho gii tinh hoa.<br /><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125142247-5443.jpg\" /><span style=\"font-size: 10pt;\"><em>Phi cnh d &aacute;n Khu &ocirc; th Vinh New Center</em>&nbsp;</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p>&nbsp;</p>', 'hang-bot-no-uy-tin-122', '<p>Khu &ocirc; th Vinh New Center ta lc tr&ecirc;n tuyn ng Quc L 1A c (ng Thng Long), x&atilde; Nghi Li&ecirc;n, l&agrave; trc giao th&ocirc;ng xng sng kh&ocirc;ng ch ri&ecirc;ng TP. Vinh m&agrave; c&ograve;n c Ngh An &amp; c nc, &acirc;y s l&agrave; c hi, tim nng ph&aacute;t trin rt ln.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125170125-0c6b.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>V tr&iacute; d &aacute;n Vinh New Center&nbsp;</em> </span></p>\r\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\"><em>D &aacute;n nm  v tr&iacute; trung t&acirc;m ca khu vc, d d&agrave;ng tip cn c&aacute;c c&ocirc;ng tr&igrave;nh thit yu.&nbsp;<br />- i din bn xe Bc Vinh.&nbsp;<br />- 50m n s&acirc;n bay Vinh.&nbsp;<br />- 200m n KCN Bc Vinh.&nbsp;<br />- 300m n i l 72m Vinh - Ca L&ograve;.&nbsp;<br />- 500m n ch Vinh - Big C.&nbsp;</em></span></p>', '<p>Khu &ocirc; th Vinh New Center s hu phong c&aacute;ch thit k nh&agrave;  tinh t, lch l&atilde;m mang hi hng ti gin ang c a chung ng&agrave;y nay. L&agrave; chn an c l&iacute; tng theo xu th hin i, ni cuc sng kh&ocirc;ng ch b bao bc bi bn bc tng m&agrave; m rng v&agrave; h&ograve;a hp vi thi&ecirc;n nhi&ecirc;n m&agrave; l&agrave; ni cuc sng l&agrave; s tn hng &uacute;ng ngha.</p>\r\n<p>D &aacute;n nm c&aacute;ch trung t&acirc;m TP Vinh kh&ocirc;ng xa, nhng mang n cm nhn kh&aacute;c bit r&otilde; n&eacute;t gia s s&ocirc;i ng, n &agrave;o ca ph x&aacute; vi mt kh&ocirc;ng gian m&aacute;t m, trong l&agrave;nh v&agrave; y&ecirc;n tnh, ph y c&acirc;y xanh. Vi thit k n&agrave;y to n&ecirc;n din mo sang trng cho khu ph, t&ocirc;n vinh c&aacute;c ch nh&acirc;n, n&acirc;ng tm gi&aacute; tr cuc sng.</p>\r\n<p>Hng ti tin &iacute;ch sng khe, sng xanh, khu c&ocirc;ng vi&ecirc;n ri&ecirc;ng t c quy hoch trong khu&ocirc;n vi&ecirc;n KT.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145023-bf9d.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin &iacute;ch Khu &ocirc; th Vinh New Center</em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145105-a7b0.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin &iacute;ch Khu &ocirc; th Vinh New Center&nbsp; </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125145120-2722.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin &iacute;ch Khu &ocirc; th Vinh New Center&nbsp; </em></span></p>', '<p>Khu &ocirc; th Vinh New Center do c&ocirc;ng ty CP Kin tr&uacute;c QTA &nbsp;t vn lp quy hoch. Vi c&aacute;c tin &iacute;ch a dng, kh&ocirc;ng gian sinh th&aacute;i trong l&agrave;nh, cng ng c d&acirc;n vn minh, hnh ph&uacute;c v&agrave; h&ograve;a hp v phong c&aacute;ch sng.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125150640-53e3.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Phi cnh mt bng tng th khu &ocirc; th Vinh New Center</em>&nbsp;</span></p>\r\n<p>D &aacute;n vi quy m&ocirc; ln bao gm 148 l&ocirc; lin k, bit th, nh&agrave; cao tng, c&ocirc;ng vi&ecirc;n, nh&agrave; sinh hot cng ng, trong &oacute; c&oacute; nhiu loi din t&iacute;ch.</p>\r\n<p>Din t&iacute;ch t 93m2, 136m2, 180m2, 200m2 &nbsp;vi mt tin t 5.5, 8m, 11m &nbsp;- ng quy hoch rng t 11m ti 15m.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125151125-d361.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Thit k nh&agrave; ph Khu &ocirc; th Vinh New Center&nbsp;</em>&nbsp;</span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125153127-7443.jpg\" /> </span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Thit k nh&agrave; ph Khu &ocirc; th Vinh New Center&nbsp;</em> </span></p>', '<p>D &aacute;n Vinh New Center c ch u t c&ocirc;ng ty CP X&acirc;y dng Sn H&agrave; m b&aacute;n v&agrave;o th&aacute;ng 1 nm 2022. Hin ti c&aacute;c nn ph&acirc;n l&ocirc; &atilde; c khi c&ocirc;ng v&agrave; tng bc trin khai.</p>\r\n<p style=\"text-align: center;\"><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125152044-92fe.jpg\" /></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin  d &aacute;n Khu &ocirc; th Vinh New Center th&aacute;ng 1 nm 2022</em> </span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em><img src=\"https://file4.batdongsan.com.vn/2022/01/25/20220125152128-3156.jpg\" /> </em></span></p>\r\n<p style=\"text-align: center;\"><span style=\"font-size: 10pt;\"><em>Tin  d &aacute;n Khu &oc